import React from 'react';
import { useQuery } from 'urql';
import gql from 'graphql-tag';
import { Link } from 'react-router-dom';

import styles from '../../styles/projects.module.scss';

const FEED_QUERY = gql`
  query {
    products {
      id
      name
      projects {
        id
        name
        status
        roles {
          person {
            name
          }
        }
      }
    }
  }
`;

const ProjectListView = ({ logout }) => {
  const [state] = useQuery({ query: FEED_QUERY });
  const { data, fetching } = state;

  return (
    <div>
      <button type="submit" onClick={logout}>
        Clicking Space
      </button>
      {!fetching ? (
        [
          <table>
            <tbody>
              <tr>
                <th>Project Name</th>
                <th>Section Lead</th>
                <th>Team Lead</th>
                <th className={styles.rtd}>Last Updated</th>
                <th className={styles.rtc}>Status</th>
              </tr>
              {data.products.map(project => {
                console.log(project);
                return (
                  <tr key={project.id}>
                    <td className={styles.title}>
                      <Link to="/" className={styles.title}>
                        {project.name}
                      </Link>
                    </td>
                    <td>{project.id}</td>
                    {/* <td>{project.team_lead}</td> */}
                    {/* <td className={styles.rtd}>{project.update}</td> */}
                    {/* <td className={styles.rtc}>{project.status}</td> */}
                  </tr>
                );
              })}
            </tbody>
          </table>,
        ]
      ) : (
        <div>fetching</div>
      )}
    </div>
  );
};

export default ProjectListView;
